import React from "react";
import { Row, Col } from "reactstrap";
import App from "../layouts/App";
import Container from 'react-bootstrap/Container';

const Home = () => (

    <App>
        <Container>
            <Row>
                <Col>1 of 2</Col>
                <Col>2of 2</Col>
            </Row>
        </Container>
    </App>

)

export default Home
